#include "jaejakso.h"int cJaejakso :: anna_jaejaksonro(){  return jaejaksonro;}void cJaejakso :: aseta_jaejaksonro(int ijaejaksonro){  jaejaksonro = ijaejaksonro;}void cJaejakso :: anna_alkujae(  char *oalkukirja,   char *oalkuluku,  char *oalkujae ){  *oalkukirja = alkukirja;  *oalkuluku = alkuluku;  *oalkujae = alkujae;};void cJaejakso :: aseta_alkujae(  char ialkukirja,   char ialkuluku,  char ialkujae ){  alkukirja = ialkukirja;  alkuluku = ialkuluku;  alkujae = ialkujae;};void cJaejakso :: anna_loppujae(  char *oloppukirja,   char *oloppuluku,  char *oloppujae ){  *oloppukirja = loppukirja;  *oloppuluku = loppuluku;  *oloppujae = loppujae;};void cJaejakso :: aseta_loppujae(  char iloppukirja,   char iloppuluku,  char iloppujae ){  loppukirja = iloppukirja;  loppuluku = iloppuluku;  loppujae = iloppujae;};